@Injectable({
  providedIn: 'root'
})
export class AcademicService {
 geteducation():any[]{
  let educationsummary=[
    {Type:"Grad",cgpa:4.5},
    {Type:"UnderGrad",cgpa:4.5},
  ]
  return educationsummary;
}
  constructor() { }
}
